Actionscript.script:
function 攻击时移动(慢速度, 快速度)
{
	if (_parent.方向 == "右")
	{
		_parent.移动("右",慢速度);
	}
	else if (_parent.方向 == "左")
	{
		_parent.移动("左",慢速度);
	}
}

//硬代码跳一下帧
function 向前跳帧(帧数)
{
	if (帧数 <= 0)
	{
		帧数 = 1;
	}
	gotoAndPlay(this._currentframe + 帧数);
}

//那好啊，他跳帧我也跳帧
function 进阶跳帧(帧数)
{
	if (_parent.宠物属性.弹射弧光斩)
	{
		gotoAndPlay(this._currentframe + 帧数);
	}
}
gotoAndPlay(_parent.近战招式);

_parent.攻击呐喊();
进阶跳帧(2);
向前跳帧(1);

// 键盘主速度，附带较弱加血
_root.敌人函数.键盘速度增益(_parent, 1);
_root.敌人函数.摇滚集体加血(_parent, "键盘集体加血", 50, 900, 600);

onClipEvent(load){
   声音 = "";
   霰弹值 = 1;
   子弹散射度 = 0;
   发射效果 = "";
   子弹种类 = "近战子弹";
   子弹威力 = _parent._parent.空手攻击力;
   子弹速度 = 0;
   击中地图效果 = "";
   Z轴攻击范围 = 30;
   击倒率 = 10;
   击中后子弹的效果 = "空手攻击火花";
   if(_parent._parent.是否为敌人 == true)
   {
      子弹敌我属性 = false;
   }
   else
   {
      子弹敌我属性 = true;
   }
   var myPoint = {x:this._x,y:this._y};
   _parent.localToGlobal(myPoint);
   _root.gameworld.globalToLocal(myPoint);
   shootX = myPoint.x;
   shootY = myPoint.y;
   _root.子弹区域shoot(声音,霰弹值,子弹散射度,发射效果,子弹种类,子弹威力,子弹速度,Z轴攻击范围,击中地图效果,_parent._parent._name,shootX,shootY,_parent._parent.Z轴坐标,子弹敌我属性,击倒率,击中后子弹的效果);
}

